import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from '@material-ui/core/TextField';
import Grid from "@material-ui/core/Grid";
import { Typography } from "@material-ui/core";
import Logo from "../images/ostello_logo.png";



// CSS Codes
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
  excelName:{
    fontSize:"43px",
    fontFamily:"Calibri",
    FontWeight:"bolder",
    color: "#6A6A6A",
    marginLeft:"8rem",
    marginTop:"1rem"
  },
  logo_img:{
    marginLeft: "8rem",
    width: "126px",
    bottom: "486px",
    marginTop: "8rem",
    cursor: "pointer",
    height:"56px"
  },
  home_info:{
      marginLeft:"8rem",
      fontSize:"16px",
      color: "#474747",
      fontFamily:"Calibri",
      fontStyle:"normal",
      fontWeight:"normal"
  },
  subscribe_heading:{
    color: "#2F2F2F",
    marginLeft:"8rem",
    fontStyle:"normal",
    fontSize:"12px",
    fontFamily:"Calibri",
    marginTop:"5rem"
  }
}));



export default function FullWidthGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={8}>
          <Typography >
            <img className={classes.logo_img} src={Logo} alt="Logo"></img>
          </Typography>
          <Typography className={classes.excelName}>
          Excellence
          </Typography>
          <Typography className={classes.home_info}>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Condimentum magna massa vitae amet purus.<br/>
          Consequat tincidunt in blandit mattis nulla eu, turpis ut. Sem in diam arcu et ac vel sed. 
          Sed nunc sit 
          </Typography>
          <Typography className={classes.subscribe_heading}>
          Subscribe now, amazing contets on your way!
          </Typography>
          <TextField
          label="Your email"
          id="outlined-size-small"
          defaultValue="Jondoeostello579@gmail.com"
          variant="outlined"
          size="large"
        />
        </Grid>
        <Grid item xs={4}>
        </Grid>
      </Grid>
    </div>
  );
}
